import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

import HomeFreelancer from './pages/dark/home-freelancer';
import Services from './components/dark/home-freelancer/Services';
import PageServicesDetails from './pages/dark/page-services-details';


function App() {
  return (
    <Router>
      <Routes>
      <Route path="/" element={<HomeFreelancer />} />
      <Route path='/services' element={<PageServicesDetails/>}/>
        
        
      </Routes>
    </Router>
  );
}

export default App;
